        .map(_.map(_.foldLeft(Some(List.empty[HNil]): Option[List[HNil]])((acc, v) => acc.flatMap(acc => v.map(_ :: acc)))))
        .map(_.map(_.map(l.foldLeft(_)((acc, v) => v :: acc))))
  }
}

